{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"NrbnnEZnMOU","title":"Muslim Woman Needs Help With Flat Tire | What Would You Do? | WWYD","lengthSeconds":"420","keywords":["Muslim","Woman","Muslims","Religion","Cars","Tires","Flat","tire","Fixing","Faith","US","ABC","News","What","Would","You","Do"],"channelId":"UCwdo8-3UrfZ9scHPl0m4Ysg","isOwnerViewing":false,"shortDescription":"A Muslim woman needs help with her car. Will reactions differ if she wears a hijab or regular street clothes? Subscribe for new episodes from What Would You Do?!  http://bit.ly/WWYDSubs\nCheck out some of the Best WWYD? Episodes  https://www.youtube.com/watch?v=Htytu...\n\nFollow What Would You Do? across the web!\nFacebook: https://www.facebook.com/wwyd \nTwitter: https://twitter.com/WWYDABC \nInstagram: https://instagram.com/wwydabc/ \n\nWhat would you do when you think no one is watching? What Would You Do? (WWYD?) explores the varying answers with the help of hidden cameras capturing individuals who have been placed within seemingly everyday situation that quickly go ary. The individuals on this hidden camera show are forced to make tough calls when directly faced with situations of racism, violence, hate crimes, and other hot button cultural issues. Catch John Quinones reporting on these individuals as they make split-second decisions to intervene or mind their own business. WWYD? airs Friday nights at 9|8c on ABC. \n\nWhat Would You Do? (WWYD) is a hidden camera show, hosted by ABC News correspondent John Quinones, in which unknowing bystanders are placed in uncomfortable, and often compromising real world scenarios in public. WWYDs hidden cameras focus on the average persons responses and reactions to these issues of social responsibility. Topics such as gay couples being affectionate in public, date rape, racism and racial profiling, interracial couples, abusive parents, drunk driving, and harassment of the homeless are touched upon in this series. What will you do? Would you choose to intervene in these situations? Watch and join the discussion.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/NrbnnEZnMOU/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLD64YTq2befRmQI7-7gPMEWv5SohA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/NrbnnEZnMOU/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDc6BhywemkQz3AgQmoNnJKsjLLfg","width":196,"height":110},{"url":"https://i.ytimg.com/vi/NrbnnEZnMOU/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDng7YrWgEb8rEd2EaJTKzqJrmB3A","width":246,"height":138},{"url":"https://i.ytimg.com/vi/NrbnnEZnMOU/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDG5xXvwWBih8dzNSs3Uw40_GvwRw","width":336,"height":188}]},"useCipher":false,"averageRating":4.7779655,"allowRatings":true,"viewCount":"9941516","author":"What Would You Do?","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"5000","endTimeMs":"420000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/wdo8-3UrfZ9scHPl0m4Ysg/featured_channel.jpg?v=56be49fd","width":49,"height":27}]},"trackingParams":"CAcQ8zciEwiIjZO545PqAhVWnlUKHRGBBCc=","navigationEndpoint":{"clickTrackingParams":"CAcQ8zciEwiIjZO545PqAhVWnlUKHRGBBCcyAml2","commandMetadata":{"webCommandMetadata":{"url":"/channel/UCwdo8-3UrfZ9scHPl0m4Ysg","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":3611}},"browseEndpoint":{"browseId":"UCwdo8-3UrfZ9scHPl0m4Ysg"}},"channelName":"What Would You Do?","subscribeButton":{"subscribeButtonRenderer":{"buttonText":{"runs":[{"text":"SUBSCRIBE"}]},"subscribed":false,"enabled":true,"type":"FREE","channelId":"UCwdo8-3UrfZ9scHPl0m4Ysg","showPreferences":false,"subscribedButtonText":{"runs":[{"text":"SUBSCRIBED"}]}
